import React from "react";
import { Element } from "react-scroll";

import { Navbar } from "./components/navbar";


export function Dum(props) {
  return (
      <Element name="dummy">

            <Navbar />
            <h1>{ this.props.display }</h1>
      </Element>
    );
}
